import React from "react";

const Navbar = () => {

    return (
        <nav>
            <div className="nav-logo-container">
                JOURNEYLAND
            </div>
            <div className="navbar-links-container">
                <a href="home">Home</a>
                <a href="about">About</a>
                <a href="features">Features</a>
            </div>
            <div className="navbar-menu-container">
            </div>
        </nav>
    );
};

export default Navbar;
